- input: "TEXT\x1CC00172619\x1C.TEXT\x1C\x1CF3A\x1CEach support that had missing information
    was sent a letter with the following text:  Recently you made a contribution to
    the Davis for Congress Campaign Committee.  We appreciate your support as it allows
    the Congressdan do do all that he can to represent the public interst.  However,
    Federal Law requires political committees to report the name, address, occupation
    and employer for each individual whose contributions aggregate in excess of $200.00
    in a calendar year.  We are also required to make certain that contributors know
    that their contributions are not tax deductible.  The name of your occupation
    and/or employer is missing from our report.  We would appreciate you supplying
    us with the requested information listed below. Please return it in the self-addressed
    stamped envelope, fax the information to 773/261-3647 or emial it to churchyone@aol.com.
    \ I appreciate the time, effort and immediate attention that you will give to
    this request.  The following people have been send two letters each with a stamped
    envelop for return:   James Noone, C.L.Price, Dr. Tonnie Young, Virgie Woods,
    Carmin A. Willis, Gary Slutkin Roberta Rakove, Raymond D. Wolf, and Diane Phillips.
    \ I have not receive a response from either of them.  I do believe that I have
    given my best efforts to seek the required information.  Those that responded
    are included in this report."
